import { useState } from 'react';
import '../App.css';

function TakeAnswer(inputValue,handleInputChange,handleSubmit) {
    
    return( //got rid of classname="App" for the div, might make it look bad
    <div>
        <label htmlFor="answerInput">Answer:    </label>
        <input type="text" id="answerInput" value={inputValue} onChange={handleInputChange}/>
        <button onClick={handleSubmit}>Submit</button>
    </div>
    );
}

export default TakeAnswer;
